import React from 'react'
import TopBar from './components/topBar'
import HeroVideo from './components/heroVideo'
import Gallery from './components/gallery'

const displayContents = {
    name: "Shed Studio",
    description: "Custom multimedia marketing packages tailored to you",
    logoUrl: "https://images.unsplash.com/photo-1543561495-9f01a9199911?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=1fcd9b091e236e7cfe259d857ee55c96&auto=format&fit=crop&w=958&q=80",
    email: "shedthestudio@gmail.com",
    social: {
        facebook: "https://facebook.com",
        instagram: "https://instagram.com",
        youtube: "https://youtube.com"
    },
    categories: {
        Events: {
            urls: ["https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4"]
        },
        Speeches: {
            urls: ["https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4"]
        },
        Tours: {
            urls: ["https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4","https://media.w3.org/2010/05/sintel/trailer_hd.mp4"]
        }
    }

}

class App extends React.Component
{
    constructor(props)
    {
        super(props)
        this.state = displayContents
    }

    render()
    {
        return(

                <div id="page-wrapper">
                    <TopBar
                    name={this.state.name}
                    social={this.state.social}
                    email={this.state.email}
                    />
                    <div id="flex-wrapper">
                        <HeroVideo src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4" />
                        <div id="gallery-container">
                            {Object.keys(this.state.categories).map(category => {
                                return <Gallery 
                                        key={category}
                                        category={category}
                                        urls={this.state.categories[category]["urls"]} />
                            })}
                        </div>
                        </div>
                </div>

        )
    }
}

export default App
